import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Input from '@material-ui/core/Input';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';
import Button from '@material-ui/core/Button';
import InputLabel from '@material-ui/core/InputLabel';
import FormControl from '@material-ui/core/FormControl';
import 'rsuite/dist/styles/rsuite-default.css';
import { DateRangePicker } from 'rsuite';

export const Filter = () => {
	return (
		<div>
			<Grid container spacing={3}>
				<Grid item xs>
					<Paper>
						<Input placeholder='Mã thành viên' />
					</Paper>
				</Grid>
				<Grid item xs>
					<Paper>
						<Input placeholder='Dịch vụ cửa hàng' />
					</Paper>
				</Grid>
				<Grid item xs>
					<Paper>
						<Button>Tìm kiếm</Button>
					</Paper>
				</Grid>
			</Grid>
			<Grid container spacing={3}>
				<Grid item xs>
					<Paper>
						<div className='dates'>
							<DateRangePicker appearance='default' placeholder='Từ ngày-Đến ngày' style={{ width: 280 }} />
						</div>
					</Paper>
				</Grid>
				<Grid item xs>
					<Paper>
						<FormControl>
							<InputLabel id='demo-simple-select-label'>Trạng thái</InputLabel>
							<Select>
								<MenuItem value={10}>Kích hoạt</MenuItem>
								<MenuItem value={20}>Chưa kích hoạt</MenuItem>
							</Select>
						</FormControl>
					</Paper>
				</Grid>
				<Grid item xs>
					<Paper></Paper>
				</Grid>
			</Grid>
		</div>
	);
};
